    static CompileLevel(dataString){
        let dataArray = [...dataString];
        for(let a = 0; a < dataArray.length - 1; a++){
            if(dataArray[a] == ":"){
                let cont = false;
                let objName = "";
                let hasCollider = false
                let sortOrd = "";
                let posX = "";
                let posY = "";
                for(let e = 0; !cont; e++){
                    if(dataArray[a + e + 1] != ","){
                        objName += dataArray[a + e + 1];
                    }
                    else cont = true;
                }
                if(dataArray[a + objName.length + 2] == "t"){
                    hasCollider = true;
                }
                cont = false;
                for(let e = 0; !cont; e++){
                    if(dataArray[a + e + objName.length + 4] != ","){
                        sortOrd += dataArray[a + e + objName.length + 4];
                    }
                    else cont = true;
                }
                cont = false;
                for(let e = 0; !cont; e++){
                    if(dataArray[a + e + objName.length + 5 + sortOrd.length] != ","){
                        posX += dataArray[a + e + objName.length + 5 + sortOrd.length];
                    }
                    else cont = true;
                }
                cont = false;
                for(let e = 0; !cont; e++){
                    if(dataArray[a + e + objName.length + 6 + sortOrd.length + posX.length] != ":"){
                        posY += dataArray[a + e + objName.length + 6 + sortOrd.length + posX.length];
                    }
                    else{
                        cont = true;
                    }
                }
                //posX = (parseFloat(posX) + 1120).toString();
                switch(objName){
                    case "gd":
                        if(hasCollider){
                            spawnEntity(new Entity("gd","ground",[new RectangleCollider(32,32,0,0), new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/RoundTilesTest/RndTlsTstNone.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        else{
                            spawnEntity(new Entity("gd","ground",[new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/RoundTilesTest/RndTlsTstNone.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        break;
                    case "wl":
                        if(hasCollider){
                            spawnEntity(new Entity("wl","ground",[new RectangleCollider(32,32,0,0), new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Wall/Wall.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        else{
                            spawnEntity(new Entity("wl","ground",[new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Wall/Wall.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        break;
                    case "st":
                        if(hasCollider){
                            spawnEntity(new Entity("st","ground",[new RectangleCollider(32,32,0,0), new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Stair.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        else{
                            spawnEntity(new Entity("st","ground",[new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Stair.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        break;
                    case "dr":
                        if(hasCollider){
                            spawnEntity(new Entity("dr","ground",[new RectangleCollider(32,32,0,0), new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Door/DoorBottom.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                            spawnEntity(new Entity("null","ground",[new RectangleCollider(32,32,0,0), new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Door/DoorTop.png",32,32,false)],"postTile"),parseFloat(posX),parseFloat(posY) + 32,1,1,0)
                        }
                        else{
                            spawnEntity(new Entity("dr","ground",[new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Door/DoorBottom.png",32,32,false)],"tile"),parseFloat(posX),parseFloat(posY),1,1,0)
                            spawnEntity(new Entity("null","ground",[new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Door/DoorTop.png",32,32,false)],"postTile"),parseFloat(posX),parseFloat(posY) + 32,1,1,0)
                        }
                        break;
                    case "bx":
                        if(hasCollider){
                            spawnEntity(new Entity("bx","ground",[new RectangleCollider(32,32,0,0), new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Box.png",32,32,false)],"tile", undefined, "destructable"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        else{
                            spawnEntity(new Entity("bx","ground",[new Renderer(sortOrd,"https://seiji-welsh.github.io/Game/Images/Tiles/Box.png",32,32,false)],"tile", undefined, "destructable"),parseFloat(posX),parseFloat(posY),1,1,0)
                        }
                        break;
                    case "enm1":
                        if(hasCollider){
                            SceneManager.enemy1(true, parseFloat(posX), parseFloat(posY));
                        }
                        break;
                    case "enm1S":
                        SceneManager.enemy1Block(parseFloat(posX), parseFloat(posY), sortOrd);
                        break;
                    case "Player":
                        SceneManager.ThePlayer(parseFloat(posX), parseFloat(posY));
                        break;
                    case "lt":
                        SceneManager.LightTile(parseFloat(posX), parseFloat(posY), sortOrd, hasCollider);
                        break;
                    case "chn":
                        SceneManager.ChainTile(parseFloat(posX), parseFloat(posY), sortOrd, hasCollider);
                        break;
                    case "sp":
                        SceneManager.SpikeTile(parseFloat(posX), parseFloat(posY), sortOrd, hasCollider);
                        break;
                    case "cg":
                        SceneManager.CageTile(parseFloat(posX), parseFloat(posY), sortOrd, hasCollider);
                        break;
                    case "cgbg":
                        SceneManager.CageBGTile(parseFloat(posX), parseFloat(posY), sortOrd, hasCollider);
                        break;
                    case "gdnr":
                        SceneManager.NonRoundGround(parseFloat(posX), parseFloat(posY), sortOrd, hasCollider);
                        break;
                }
            }
        }
    }
